import './App.js'
import { useState,useEffect}from 'react'
const CurrencyInput=({amount,currencies})=> {


  return (
    <div>
        <div>
            <input value={amount}/>
            <select>
             {currencies.map(currency=>{
              (
              <option value={currency}>{currency}</option>
              )
             })}
            </select>

        </div>
    </div>
  )
}

export default CurrencyInput
